const Services_thumb: React.FC = () => {
    return (
        <div className="col-6">
            <div className="about-thumb">
                 <h3>Lire ce</h3>
            </div>
            <div className="about-image"></div>
            <div className="about-bounce"></div>
      </div>
    );
};

export default Services_thumb;
